import '../styles/Presentation.css'
import bg from '../assets/bg-apropos.png'

function PresentationAbout() {
    return (
        <div className="bg-presentation--apropos">
            <img src={bg} alt="bg-apropos" />
        </div>
    )
}

export default PresentationAbout
